    - Member[BytewaxMaterializationEngineConfig]
  - - pydantic.BaseModel~Subclass
    - bytewax
    - Member[bytewax_materialization_dataflow].Member[RepoConfig]
  - - pydantic.BaseModel~Subclass
    - bytewax
    - Member[bytewax_materialization_engine].Member[BytewaxMaterializationEngineConfig]
  - - pydantic.BaseModel~Subclass
    - bytewax
    - Member[bytewax_materialization_engine].Member[FeastConfigBaseModel]
  - - pydantic.BaseModel~Subclass
    - bytewax
    - Member[bytewax_materialization_engine].Member[RepoConfig]
  - - pydantic.BaseModel~Subclass
    - bytewax
    - Member[dataflow].Member[RepoConfig]
